				else if ((Inputs.cmb_coresolution.Value != "") && (Inputs.cmb_sector.Value != ""))
        {
            if (Inputs.chr_partnum.Value != "")
            {

                available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_company.Value);
                if (available_part) {

                    if (((Inputs.var_company.Value == "TENLT") || (Inputs.var_company.Value == "TENSAFZ") || (Inputs.var_company.Value == "TENUSA")) && (Inputs.chk_erroron.Value == true)) {

