												MessageBox.Show("La rfrence utilise correspond  un article existant. Toute rfrence utilise ne doit pas dj figur dans la base EPICOR afin d'viter de rentrer en conflit avec la mthode de fabrication. Entrez une nouvelle rfrence.", "Erreur", MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
